            string CustomCharset = "!\"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_`abcdefghijklmnopqrstuvwxyz{|}~";

            MemoryStream ArialCustomCharset16 = new MemoryStream(Convert.FromBase64String(""));
            BitFont.RegisterBitFont("ArialCustomCharset16", new BitFontDescriptor(CustomCharset, ArialCustomCharset16, 16));

            //MemoryStream VerdanaCustomCharset24 = new MemoryStream(Convert.FromBase64String(""));
            //BitFont.RegisterBitFont("VerdanaCustomCharset24", new BitFontDescriptor(CustomCharset, VerdanaCustomCharset24, 24));

            MemoryStream MicrosoftSansSerifCustomCharset24 = new MemoryStream(Convert.FromBase64String(""));
            BitFont.RegisterBitFont("VerdanaCustomCharset24", new BitFontDescriptor(CustomCharset, MicrosoftSansSerifCustomCharset24, 24));
        }
    }
